        "description": "<p>Nsleep là một sản phẩm gối cho trẻ em cao cấp, được thiết kế để mang lại sự an toàn và thoải mái cho bé. Nsleep có những đặc điểm nổi bật sau:</p><ul><li>Vỏ gối cho trẻ em được làm từ vải tencel, một loại vải tự nhiên có khả năng thấm hút ẩm và kháng khuẩn tốt. Vải tencel còn có độ mềm mại và mịn màng, không gây kích ứng da hay tạo nếp nhăn.</li><li>Ruột gối cho trẻ em được làm từ bông kapok, một loại bông thực vật có nguồn gốc từ cây gòn. Bông kapok có độ bền cao, không bị xẹp lún hay biến dạng theo thời gian. Bông kapok cũng có tính năng chống ẩm, chống nấm mốc và chống côn trùng.</li><li>Kích thước của gối cho trẻ em là 40cm x 45cm, phù hợp với kích thước của bé và ga trải giường. Trọng lượng của gối cho trẻ em là 80g, rất nhẹ để bé có thể ôm và mang theo.</li><li>Sản phẩm được sản xuất tại Việt Nam, đảm bảo chất lượng và an toàn cho sức khỏe.</li></ul><p>Nsleep là sự lựa chọn hoàn hảo cho những bé yêu muốn có một giấc ngủ ngon và sâu. Nsleep sẽ giúp bé giảm căng thẳng, thư giãn cơ thể và tinh thần. Hãy đến với Nsleep để trải nghiệm sự khác biệt!</p><p>----------</p><table id=\"product-attribute-specs-table\"><tbody><tr><th scope=\"row\">Sản phẩm</th><td>Ruột gối ngủ</td></tr><tr><th scope=\"row\">Bộ sưu tập</th><td>NSLEEP</td></tr><tr><th scope=\"row\">Kích cỡ</th><td>L40xW45 ∙ 130 g ∙ For baby</td></tr><tr><th scope=\"row\">Màu sắc</th><td>Hồng/ trắng</td></tr><tr><th scope=\"row\">Chất liệu</th><td>Tencel-Kapok-filling</td></tr><tr><th scope=\"row\">Xuất xứ</th><td>Việt Nam</td></tr><tr><th scope=\"row\">Kiểu dáng</th><td>Heritage-Asian</td></tr><tr><th scope=\"row\">Đơn vị</th><td>PCS</td></tr></tbody></table>",
